local math_ceil = math.ceil
local MidSearch = function(t, v)
  local l = 1
  local r = #t
  local m = math_ceil((l + r) / 2)
  while l ~= m do
    if t[m] == v then
      return true
    elseif v > t[m] then
      l = m + 1
    else
      r = m - 1
    end
    m = math_ceil((l + r) / 2)
  end
  return t[l] == v
end
local priorityList = {}
