  table.sort(priorityList, function(a, b)
    local delta_a = math.abs(Dialog_Index[a][1] - id)
    local delta_b = math.abs(Dialog_Index[b][1] - id)
    return delta_a < delta_b
  end)
  for i = 1, #priorityList do
    local index = priorityList[i]
    if MidSearch(Dialog_Index[index], id) then
      return Dialog_Index_NameMap[index]
    end
  end
  return nil
end
